import './App.css';
import TrelloList from './components/TrelloList';
import { makeStyles } from '@mui/styles';

const useStyle = makeStyles(theme => ({
  roots: {
    minHeight:"100vh",
    overflowY:"auto"
  },
  container: {
    display:"flex"
  }

}));

function App() {
  const classes = useStyle();
  return (
    <div className={classes.roots}>
      <TrelloList className={classes.container}/>
      <TrelloList/>
    </div>
  );
}

export default App;
